import styled from "styled-components";

export const SSection = styled.section`
  max-width: 1200px;
  padding: 20px 40px;
  margin-top: 20px;
  background-color: #fff;
`;

export const SBox = styled.div`
  width: 50%;
  display: block;

  .boxinner {
    margin-top: 10px;
  }

  input {
    width: 400px;
    height: 30px;
    margin-bottom: 10px;
  }

  img {
    min-width: 200px;
    min-height: 200px;
    border: 1px solid;
  }
`
